"Full URL of the repository" => "URL complète du dépot",
"Please see <a href=\"http://doc.tikiwiki.org/\">the documentation</a> for more information" => "Reportez-vous à <a href=\"http://doc.tikiwiki.org/\">la documentation</a> pour plus d'informations",
"Using <strong>%0</strong>.These stats affect all PHP applications running on the server" => "Utilisation de <strong>%0</strong>. Ces statistiques sont valables pour toutes les applications PHP s'exécutant sur le serveur",
"Configuration setting <em>xcache.admin.enable_auth</em> prevents from accessing statistics. This will also prevent the cache from being cleared when clearing template cache" => "L'option de configuration <em>xcache.admin.enable_auth</em> empêche l'accès aux statistiques. Cela empêchera aussi le réinitialisation du cache lors de la réinitialisation des templates",
"Few hits recorded. Statistics may not be representative" => "Peu d'accès au cache enregistrés, les statistiques ne sont peut-être pas représentatives",
"Low hit ratio. %0 may be misconfigured and not used" => "Le ratio d'accès au cache est faible. %0 est peut-être mal configuré ou désactivé",
"Little memory available. Thrashing likely to occur" => "Peu de mémoire disponible. L'éviction rapide du cache est susceptible de se produire",
"Small amount of memory allocated to %0. Verify the configuration" => "Peu de mémoire est allouée à %0. Vérifiez sa configuration",
"Configuration <em>%0</em> is enabled. Disabling modification checks can improve performance, but will require manual clear on file updates" => "La configuration de <em>%0</em> est active. La désactivation des vérifications de modifications peut améliorer les performances, mais il sera nécessaire de purger manuellemnt les caches lors de la mise à jour des fichiers",
"<em>%0</em> should not be disabled due to authentication on XCache" => "<em>%0</em> ne devrait pas être désactivé à cause de l'authentification",
"Bytecode cache is not used. Using a bytecode cache (APC, XCache) is highly recommended for production environments" => "Aucun cache de Bytecode n'est utilisé. L'utilisation d'un cache (APC, XCache) est fortement recommandé dans environnement de production",
"This allows a mixture of wiki and html. All wiki syntax is parsed" => "Ceci permet le mélange du HTML et de la syntaxe wiki. Toute la syntaxe wiki est interprétée",
"This also allows a mixture of wiki and html. Only some wiki syntax is parsed, such as plugins (not inline character styles etc)" => "Ceci permet aussi le mélange du HTML et de la syntaxe wiki. Seuls quelques éléments de la syntaxe wiki seront interprétés, comme les plugins (mais pas les styles de caractères, etc.)",
"Most of these features are hoped to make it into the \"new\" section for Tiki 6" => "La plupart de ces fonctionnalités devraient faire leur apparition dans la section \"Nouveau\" pour Tiki 6",
"This search feature and the <a href=\"tiki-edit_perspective.php\">perspectives GUI</a> need <a href=\"http://dev.tiki.org/Dynamic+Preferences\">dev.tiki.org/Dynamic+Preferences</a>. If you search for something and it's not appearing, please help improve keywords/descriptions" => "Cette recherche de fonctionnalités ainsi que <a href=\"tiki-edit_perspective.php\">l'interface des prespectives</a> ont besoin d'une page <a href=\"http://dev.tiki.org/Dynamic+Preferences\">http://dev.tiki.org/Dynamic+Preferences</a>. Si votre recherche est infructueuse, aidez nous à améliorer les descriptions et les mots clef des préférences",
"Use three colons instead of two to center text. Avoids conflict with C++ resolution scope operator" => "Utiliser trois double-point à la place de deux pour centrer le texte. Ceci évite les conflits avec les opérateurs de portée C++",
"This field is mandatory unless both feed author email and homepage are empty" => "Ce champ est obligatoire sauf si l'email de l'auteur du flux et sa page d'accueil sont vides tous les deux",
"This will attempt as much as possible to hide the email, showing the realname or the truncated email instead" => "Ceci tentera autant que possible de cacher l'email, en montrant le nom réel ou l'email tronqué à la place",
